import React, { useState, useEffect } from 'react'

export default function index() {
    const [date, updateDate] = useState(new Date().toDateString())
    useEffect(() => {
        setInterval(() => {
            updateDate(new Date().toDateString())
        }, 50)
    }, [])
    return (
        <div>
            hello this is my {date}
        </div>
    )
}
